import React from 'react'

export const SearchBox = ({ searchChange }) => {
    return (
        <div>
            <input className='pa3 ba b--green bg-light-blue' 
            type="search"
            placeholder=""
            onChange={searchChange}/>
        </div>
    )
}

export default SearchBox
